@ericburgettmusic joined @radiopatrick in the studio this morning and wowed us with his impressive piano-playing skills. Amazing voice and talented musician, he can do it all! We can’t wait to have him join us again on PickleJar Up All Night. 

Don’t stay up all night? Find highlights from the show at picklejarupallnight.com!

